  - class: identifier
  throughput: 0.0
  latency: 0.0
  port_pressure: []
- name: [jc, jb, jae, jnb, jna, jbe, ja, jnbe]
  operands:
  - class: identifier
  throughput: 0.0
  latency: 0.0
  port_pressure: []
- name: [je, jz, jne, jnz, jl, jnge]
  operands:
  - class: identifier
  throughput: 0.0
  latency: 0.0
  port_pressure: []
- name: [jge, jnl, jle, jng, jg, jnle]
